import axios from "axios";
import React from "react";
const url = "http://localhost:8000/api";

function Get() {

    const [data, setData] = React.useState([]);

    React.useEffect(() => {
    axios.get(url).then((res) => {
        console.log(res.data);
    });
    }, [setData]);
    return (
        <div>
            <h1>Get</h1>
            {data.map((item) => {
                return (
                    <div key={item.id}>
                        <h3>{item.cont}</h3>
                        <p>{item.body}</p>
                    </div>
                );

            })}
        </div>
    )
}

export default Get;
